INSERT INTO `buying_proposals` VALUES (9,'567567',5567,'3 Weeks',1,23,32,'Approved','2016-06-09 09:23:54','2016-06-11 05:38:56',0,1,1,NULL),(10,'4534545',54,'2 Weeks',3,24,32,'New','2016-06-09 12:03:35','2016-06-09 12:03:35',0,1,1,NULL),(12,'5676576',55657,'1 Week',1,25,32,'Approved','2016-06-10 11:16:49','2016-06-10 17:27:29',0,1,1,NULL),(13,'dfgdfgfdg',4544,'2 Weeks',2,16,32,'New','2016-06-11 07:28:07','2016-06-11 07:28:07',0,1,1,NULL),(14,'Abcd',3.33333e16,'2 Weeks',2,17,32,'New','2016-06-11 07:29:34','2016-06-11 07:29:34',0,1,1,NULL),(15,'sutil.exe is a built in filesystem tool that is useful to do file system related operations from command line. We can create a file of required size using this tool.\r\n\r\nsyntax to create a file:\r\n\r\nfsutil file createnew filename length\r\n\r\n(length is in bytes)\r\n\r\nFor example, to create a dummy file test.txt, with size as 50MB :\r\n\r\nfsutil file createnew test.txt 52428800',56.0436,'1 Week',1,28,32,'Approved','2016-06-11 09:36:43','2016-06-11 09:41:08',0,1,1,NULL),(16,'rtyrt',1.5e29,'1 Week',1,29,32,'Approved','2016-06-11 09:46:59','2016-06-11 09:55:23',0,1,1,NULL),(17,'rtyrt',15000000,'1 Week',1,29,32,'Approved','2016-06-11 09:47:51','2016-06-11 09:55:40',0,1,1,NULL),(18,'rtyrthujghj',1.5e29,'1 Week',1,29,32,'Approved','2016-06-11 09:48:14','2016-06-11 09:56:05',0,1,1,NULL),(19,'rtyrthujghj',150000000,'2 Weeks',2,29,32,'New','2016-06-11 09:51:43','2016-06-11 09:51:43',0,1,1,NULL),(20,'rtyrthujghj',150000000000,'2 Weeks',2,29,32,'New','2016-06-11 09:51:59','2016-06-11 09:51:59',0,1,1,NULL),(21,'rtyrthujghj',12,'1 Week',1,29,32,'Approved','2016-06-11 10:05:48','2016-06-11 10:27:31',0,1,1,NULL),(22,'ghghj',564456000000,'2 Weeks',3,29,1,'New','2016-06-11 10:12:49','2016-06-11 10:12:49',0,1,1,NULL),(23,'ghghjhjkhj',676,'2 months',41,29,1,'Approved','2016-06-11 10:13:02','2016-06-11 11:20:13',0,1,1,NULL),(24,'\r\nTurnkey Dewatering Solutions\r\n\r\nArabian Equipment Rentals offers turnkey contract dewatering solutions and project evaluation by calculating and offering single, double or multistage well point dewatering systems, through deep wells or submersible pumps strategically located within the dewatering area.\r\n\r\nComplete project dewatering evaluation is available and informed decisions made on which method is the most cost effective method of dewatering for specific requirements. All the well point dewatering equipment used by Arabian Equipment Rentals has been developed to meet the harsh conditions of the Middle East. Systems are lightweight, corrosive resistant and incorporate modern control features.\r\n\r\nDeep well installations are available using either slotted PVC or steel well casings. Installation, recovery, on- going assistance and servicing is also provided.\r\n',2500000000,'1 Week',1,30,32,'Approved','2016-06-11 11:11:12','2016-06-11 11:45:26',0,1,1,NULL),(25,'Dear Sir\r\n\r\nA wind turbine is a device that converts the wind\'s kinetic energy into electrical power. The term appears to have been adopted from hydroelectric technology (rotary propeller). The technical description of a wind turbine is aerofoil-powered generator.\r\n\r\nAs a result of over a millennium of windmill development and modern engineering, today\'s wind turbines are manufactured in a wide range of vertical and horizontal axis types. The smallest turbines are used for applications such as battery charging for auxiliary power for boats or caravans or to power traffic warning signs. Slightly larger turbines can be used for making contributions to a domestic power supply while selling unused power back to the utility supplier via the electrical grid. Arrays of large turbines, known as wind farms, are becoming an increasingly important source of renewable energy and are used by many countries as part of a strategy to reduce their reliance on fossil fuels.',345000,'2 Months',1,32,48,'Approved','2016-06-11 17:17:56','2016-06-11 17:21:30',0,1,1,'Frequency_per_countries.docx'),(27,'32242424242