18:19:23','2016-06-12 18:19:23',0,1,1),(27,'info@powercozmo.com','Coil','Winding\" redirects here. For other uses, see <a href=\"https://en.wikipedia.org/wiki/Winding_%28disambiguation%29\" class=\"mw-disambig\" title=\"Winding (disambiguation)\">Winding (disambiguation)</a>.\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width:222px;\"><a href=\"https://en.wikipedia.org/wiki/File:Magnetic_field_of_loop_3.svg\" class=\"image\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b7/Magnetic_field_of_loop_3.svg/220px-Magnetic_field_of_loop_3.svg.png\" class=\"thumbimage\" data-file-width=\"772\" data-file-height=\"770\" height=\"219\" width=\"220\"></a>\r\n<div class=\"thumbcaption\">\r\n</div></div></div><div class=\"thumb tright\"><div class=\"thumbinner\" style=\"width:222px;\"><div class=\"thumbcaption\">\r\nThe magnetic field lines <i>(<span style=\"color:green;\">green</span>)</i> of a current-carrying loop of wire pass through the center of the loop, concentrating the field there</div>\r\n</div>\r\n</div>\r\n<p>An <b>electromagnetic coil</b> is an electrical <a href=\"https://en.wikipedia.org/wiki/Electrical_conductivity\" class=\"mw-redirect\" title=\"Electrical conductivity\">conductor</a> such as a <a href=\"https://en.wikipedia.org/wiki/Wire\" title=\"Wire\">wire</a> in the shape of a <a href=\"https://en.wiktionary.org/wiki/coil\" class=\"extiw\" title=\"wiktionary:coil\">coil</a>, <a href=\"https://en.wikipedia.org/wiki/Spiral\" title=\"Spiral\">spiral</a> or <a href=\"https://en.wikipedia.org/wiki/Helix\" title=\"Helix\">helix</a>.<sup id=\"cite_ref-Stauffer_1-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Stauffer-1\">[1]</a></sup><sup id=\"cite_ref-Laplante_2-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Laplante-2\">[2]</a></sup> Electromagnetic coils are used in <a href=\"https://en.wikipedia.org/wiki/Electrical_engineering\" title=\"Electrical engineering\">electrical engineering</a>, in applications where <a href=\"https://en.wikipedia.org/wiki/Electric_current\" title=\"Electric current\">electric currents</a> interact with <a href=\"https://en.wikipedia.org/wiki/Magnetic_field\" title=\"Magnetic field\">magnetic fields</a>, in devices such as <a href=\"https://en.wikipedia.org/wiki/Inductor\" title=\"Inductor\">inductors</a>, <a href=\"https://en.wikipedia.org/wiki/Electromagnet\" title=\"Electromagnet\">electromagnets</a>, <a href=\"https://en.wikipedia.org/wiki/Transformer\" title=\"Transformer\">transformers</a>,\r\n and sensor coils. Either an electric current is passed through the wire\r\n of the coil to generate a magnetic field, or conversely an external <i>time-varying</i> magnetic field through the interior of the coil generates an <a href=\"https://en.wikipedia.org/wiki/Electromotive_force\" title=\"Electromotive force\">EMF</a> (<a href=\"https://en.wikipedia.org/wiki/Voltage\" title=\"Voltage\">voltage</a>) in the conductor.</p>\r\n<p>A current through any conductor creates a circular magnetic field around the conductor due to <a href=\"https://en.wikipedia.org/wiki/Ampere%27s_circuital_law\" class=\"mw-redirect\" title=\"Ampere\'s circuital law\">Ampere\'s law</a>.<sup id=\"cite_ref-Arun_3-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Arun-3\">[3]</a></sup>\r\n The advantage of using the coil shape is that it increases the strength\r\n of magnetic field produced by a given current. The magnetic fields \r\ngenerated by the separate turns of wire all pass through the center of \r\nthe coil and add (<a href=\"https://en.wikipedia.org/wiki/Superposition_principle\" title=\"Superposition principle\">superpose</a>) to produce a strong field there.<sup id=\"cite_ref-Arun_3-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Arun-3\">[3]</a></sup> The more turns of wire, the stronger the field produced. Conversely, a <i>changing</i> external magnetic flux induces a voltage in a conductor such as a wire, due to <a href=\"https://en.wikipedia.org/wiki/Faraday%27s_law_of_induction\" title=\"Faraday\'s law of induction\">Faraday\'s law of induction</a>.<sup id=\"cite_ref-Arun_3-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Arun-3\">[3]</a></sup><sup id=\"cite_ref-4\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-4\">[4]</a></sup>\r\n The induced voltage can be increased by winding the wire into a coil, \r\nbecause the field lines intersect the circuit multiple times.<sup id=\"cite_ref-Arun_3-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Arun-3\">[3]</a></sup></p>\r\nThe direction of the magnetic field produced by a coil can be determined by the <a href=\"https://en.wikipedia.org/wiki/Right_hand_grip_rule\" class=\"mw-redirect\" title=\"Right hand grip rule\">right hand grip rule</a>. If the fingers of the right hand are',NULL,32,35,'Approved','2016-06-13 04:52:56','2016-06-13 04:53:35',0,1,1),(28,'info@powercozmo.com','Coil','gughjg<br>',NULL,32,35,'New','2016-06-13 08:41:31','2016-06-13 08:41:31',0,1,1),(29,'info@powercozmo.com','Coil','676786787<br>',NULL,32,35,'New','2016-06-13 08:41:47','2016-06-13 08:41:47',0,1,1),(30,'info@powercozmo.com','Coil','eyrtyrtyrtytyrtyryty<br>',NULL,32,35,'New','2016-06-13 08:55:59','2016-06-13 08:55:59',0,1,1),(31,'info@powercozmo.com','Coil','123456789900877<br>346567889<br>566778787<br>',NULL,32,35,'New','2016-06-13 08:58:10','2016-06-13 08:58:10',0,1,1),(32,'info@powercozmo.com','Coil','ewrert<br>',NULL,32,35,'New','2016-06-13 08:58:50','2016-06-13 08:58:50',0,1,1),(33,'info@powercozmo.com','Coil','THis is a test message',NULL,32,35,'New','2016-06-13 09:15:05','2016-06-13 09:15:05',0,1,1),(34,'info@powercozmo.com','1500Hp drilling rig','This is a test','080116