\nthe release of Letraset sheets containing Lorem Ipsum passages, and more\r\n recently with desktop publishing software like Aldus PageMaker \r\nincluding versions of Lorem Ipsum.</p>\r\n</div><div>\r\n<h2>Why do we use it?</h2>\r\n<p>It is a long established fact that a reader will be distracted by the\r\n readable content of a page when looking at its layout. The point of \r\nusing Lorem Ipsum is that it has a more-or-less normal distribution of \r\nletters, as opposed to using \'Content here, content here\', making it \r\nlook like readable English. Many desktop publishing packages and web \r\npage editors now use Lorem Ipsum as their default model text, and a \r\nsearch for \'lorem ipsum\' will uncover many web sites still in their \r\ninfancy. Various versions have evolved over the years, sometimes by \r\naccident, sometimes on purpose (injected humour and the like).</p>\r\n</div><br><div>\r\n<h2>Where does it come from?</h2>\r\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It\r\n has roots in a piece of classical Latin literature from 45 BC, making \r\nit over 2000 years old. Richard McClintock, a Latin professor at \r\nHampden-Sydney College in Virginia, looked up one of the more obscure \r\nLatin words, consectetur, from a Lorem Ipsum passage, and going through \r\nthe cites of the word in classical literature, discovered the \r\nundoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 \r\nof \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by \r\nCicero, written in 45 BC. This book is a treatise on the theory of \r\nethics, very popular during the Renaissance. The first line of Lorem \r\nIpsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section \r\n1.10.32.</p><p>The standard chunk of Lorem Ipsum used since the 1500s is\r\n reproduced below for those interested. Sections 1.10.32 and 1.10.33 \r\nfrom \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in \r\ntheir exact original form, accompanied by English versions from the 1914\r\n translation by H. Rackham.</p>\r\n</div><div>\r\n<h2>Where can I get some?</h2>\r\n<p>There are many variations of passages of Lorem Ipsum available, but \r\nthe majority have suffered alteration in some form, by injected humour, \r\nor randomised words which don\'t look even slightly believable. If you \r\nare going to use a passage of Lorem Ipsum, you need to be sure there \r\nisn\'t anything embarrassing hidden in the middle of text. All the Lorem \r\nIpsum generators on the Internet tend to repeat predefined chunks as \r\nnecessary, making this the first true generator on the Internet. It uses\r\n a dictionary of over 200 Latin words, combined with a handful of model \r\nsentence structures, to generate Lorem Ipsum which looks reasonable. The\r\n generated Lorem Ipsum is therefore always free from repetition, \r\ninjected humour, or non-characteristic words etc.</p>\r\n<form method=\"post\" action=\"/feed/html\"><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\"><tbody><tr><td rowspan=\"2\"><input name=\"amount\" value=\"5\" size=\"3\" id=\"amount\" type=\"text\"></td><td rowspan=\"2\"><table align=\"left\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td width=\"20\"><input name=\"what\" value=\"paras\" id=\"paras\" checked=\"checked\" type=\"radio\"></td><td><label for=\"paras\">paragraphs</label></td></tr><tr><td width=\"20\"><input name=\"what\" value=\"words\" id=\"words\" type=\"radio\"></td><td><label for=\"words\">words</label></td></tr><tr><td width=\"20\"><input name=\"what\" value=\"bytes\" id=\"bytes\" type=\"radio\"></td><td><label for=\"bytes\">bytes</label></td></tr><tr><td width=\"20\"><input name=\"what\" value=\"lists\" id=\"lists\" type=\"radio\"></td><td><label for=\"lists\">lists</label></td></tr></tbody></table></td><td width=\"5%\"><input name=\"start\" id=\"start\" value=\"yes\" checked=\"checked\" type=\"checkbox\"></td><td style=\"text-align:left\" width=\"45%\"><label for=\"start\">Start with \'Lorem<br>ipsum dolor sit amet...\'</label></td></tr><tr><td><br></td><td style=\"text-align:left\"><br></td></tr></tbody></table></form></div></div><hr><div class=\"boxedTight\"><a href=\"http://www.lipsum.com/116/1465627543/ding.io\" target=\"_blank\" rel=\"nofollow\"><img src=\"http://www.lipsum.com/banners/ding.png\" alt=\"Time tracking for freelancers\" border=\"0\" width=\"100%\"></a></div>\r\n<hr><div class=\"boxed\" style=\"color:#ff0000;\"><strong>Translations:</strong> Can you help translate this site into a foreign language ? Please email us with details if you can help.</div>\r\n\r\n<hr><div class=\"boxed\">There are now a set of mock banners available <a href=\"http://www.lipsum.com/banners\" class=\"lnk\">here</a> in three colours and in a range of standard banner sizes:<br><a href=\"http://www.lipsum.com/banners\"><img src=\"http://www.lipsum.com/images/banners/black_234x60.gif\" alt=\"Banners\" border=\"0\" height=\"60\" width=\"234\"></a><a href=\"http://www.lipsum.com/banners\"><img title=\"Image: http://www.lipsum.com/images/banners/grey_234x60.gif\" src=\"http://www.lipsum.com/images/banners/grey_234x60.gif\" alt=\"Banners\" border=\"0\" height=\"60\" width=\"234\"></a><a href=\"http://www.lipsum.com/banners\"><img src=\"http://www.lipsum.com/images/banners/white_234x60.gif\" alt=\"Banners\" border=\"0\" height=\"60\" width=\"234\"></a></div>\r\n\r\n<hr><div class=\"boxed\"><strong>Donate:</strong> If you use this site \r\nregularly and would like to help keep the site on the Internet, please \r\nconsider donating a small sum to help pay for the hosting and bandwidth \r\nbill. There is no minimum donation, any sum is appreciated - click <a target=\"_blank\" href=\"http://www.lipsum.com/donate\" class=\"lnk\">here</a> to donate using PayPal. Thank you for your support.</div>\r\n\r\n<hr><div class=\"boxed\" id=\"Packages\">\r\n<a target=\"_blank\" rel=\"nofollow\" href=\"https://chrome.google.com/ex