,NULL,'2016-06-11 07:11:38','2016-06-11 07:11:38'),(22,152,'ok..done<br>',2,1,32,1,'2016-06-11 12:25:44','2016-06-13 07:28:08'),(23,140,'kl',1,0,39,NULL,'2016-06-11 17:52:16','2016-06-11 17:52:16'),(30,147,'ERETERTRETETETETETETETETETE<br>RTRRTYTRYT<br>DSFSDGFG<br>DFGDFGDFGF<br>FG<br>DFGDFGDGDF<br>GDF<br>GD<br>FG<br>FDG<br>DFG<br>DF<br>GD<br>FG<br>D<br><br>GFD<br>G<br>',1,1,32,NULL,'2016-06-13 07:30:39','2016-06-13 07:30:39'),(31,113,'hello <br>What is the <br>price<br>',2,1,32,1,'2016-06-14 04:40:24','2016-06-16 12:20:31'),(32,161,'<div id=\"text\">\r\n			<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do \r\neiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad \r\nminim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip \r\nex ea commodo consequat. Duis aute irure dolor in reprehenderit in \r\nvoluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur \r\nsint occaecat cupidatat non proident, sunt in culpa qui officia deserunt\r\n mollit anim id est laborum.</p>		</div>',1,1,32,NULL,'2016-06-14 06:00:25','2016-06-14 06:00:25'),(33,164,'<div id=\"text\">\r\n			<p><br></p>		</div>',2,1,32,1,'2016-06-14 06:03:36','2016-06-14 06:05:26'),(34,165,'<a href=\"http://202.131.125.142:3003/admin/equipment/43\">Used Fg wilson p550 For Sale</a><br><a href=\"http://202.131.125.142:3003/admin/equipment/43\">Used Fg wilson p550 For Sale</a><br><a title=\"Link: http://202.131.125.142:3003/admin/equipment/43\" href=\"http://202.131.125.142:3003/admin/equipment/43\">Used Fg wilson p550 For Sale</a><a href=\"http://202.131.125.142:3003/admin/equipment/43\">Used Fg wilson p550 For Sale</a><a href=\"http://202.131.125.142:3003/admin/equipment/43\">Used Fg wilson p550 For Sale</a><br><br>',2,1,32,1,'2016-06-14 06:16:50','2016-06-14 08:12:05'),(35,166,'<h3><span class=\"mw-headline\" id=\"Commutator\">Commutator</span></h3><div role=\"note\" class=\"hatnote relarticle mainarticle\">Main article: <a href=\"https://en.wikipedia.org/wiki/Commutator_%28electric%29\" title=\"Commutator (electric)\">Commutator (electric)</a></div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width:222px;\"><a href=\"https://en.wikipedia.org/wiki/File:Tiny_motor_windings_-_commutator_-_brushes_in_Zip_Zaps_toy_R-C_car.jpg\" class=\"image\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/d/dc/Tiny_motor_windings_-_commutator_-_brushes_in_Zip_Zaps_toy_R-C_car.jpg/220px-Tiny_motor_windings_-_commutator_-_brushes_in_Zip_Zaps_toy_R-C_car.jpg\" class=\"thumbimage\" data-file-width=\"2523\" data-file-height=\"1479\" height=\"129\" width=\"220\"></a>\r\n<div class=\"thumbcaption\">\r\n</div></div></div><div class=\"thumb tright\"><div class=\"thumbinner\" style=\"width:222px;\"><div class=\"thumbcaption\">\r\nA toy\'s small DC motor with its commutator</div>\r\n</div>\r\n</div>\r\n<p>A <a href=\"https://en.wikipedia.org/wiki/Commutator_%28electric%29\" title=\"Commutator (electric)\">commutator</a> is a mechanism used to <a href=\"https://en.wikipedia.org/wiki/Switch\" title=\"Switch\">switch</a>\r\n the input of most DC machines and certain AC machines consisting of \r\nslip ring segments insulated from each other and from the electric \r\nmotor\'s shaft. The motor\'s armature current is supplied through the \r\nstationary <a href=\"https://en.wikipedia.org/wiki/Brush_%28electric%29\" title=\"Brush (electric)\">brushes</a>\r\n in contact with the revolving commutator, which causes required current\r\n reversal and applies power to the machine in an optimal manner as the <a href=\"https://en.wikipedia.org/wiki/Rotor_%28electric%29\" title=\"Rotor (electric)\">rotor</a> rotates from pole to pole.<sup id=\"cite_ref-55\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-55\">[54]</a></sup><sup id=\"cite_ref-56\" class=\"reference\"><a title=\"Link: https://en.wikipedia.org/wiki/Electric_motor#cite_note-56\" href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-56\">[55]</a></sup>\r\n In absence of such current reversal, the motor would brake to a stop. \r\nIn light of significant advances in the past few decades due to improved\r\n technologies in electronic controller, sensorless control, induction \r\nmotor, and permanent magnet motor fields, electromechanically commutated\r\n motors are increasingly being displaced by externally commutated \r\ninduction and <a href=\"https://en.wikipedia.org/wiki/Permanent-magnet_motor\" class=\"mw-redirect\" title=\"Permanent-magnet motor\">permanent-magnet motors</a>.</p>',1,1,32,NULL,'2016-06-14 06:28:19','2016-06-14 06:28:19'),(36,168,'<div><table height=\"359\" width=\"884\"><caption style=\"background:#f0f0f0;\" align=\"center\"><b>Major Categories</b><br></caption>\r\n<caption style=\"background:#f0f0f0;\" align=\"center\"><b>by</b></caption>\r\n<caption style=\"background:#f0f0f0;\" align=\"center\"><b>Type of Motor Commutation</b><br>\r\n<sup id=\"cite_ref-USDOEVSPGuide_57-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-USDOEVSPGuide-57\">[56]</a></sup><sup id=\"cite_ref-Bose_.282006.29_58-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Bose_.282006.29-58\">[57]</a></sup><sup id=\"cite_ref-King_.28UA.29_59-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-King_.28UA.29-59\">[58]</a></sup><sup id=\"cite_ref-Hameyer_.2A2001.29_60-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Hameyer_.2A2001.29-60\">[59]</a></sup><sup id=\"cite_ref-Stolting_.282008.29_61-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Stolting_.282008.29-61\">[60]</a></sup><sup id=\"cite_ref-Ionel_.282010.29_62-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Ionel_.282010.29-62\">[61]</a></sup></caption>\r\n<tbody><tr>\r\n<th colspan=\"3\" style=\"background:#f0f0f0;\" align=\"center\">Self-Commutated</th>\r\n<th colspan=\"2\" style=\"background:#f0f0f0;\" align=\"center\">Externally Commutated</th>\r\n</tr>\r\n<tr>\r\n<th colspan=\"2\" style=\"background:#f0f0f0;\" align=\"center\">Mechanical-<br>\r\nCommutator Motors</th>\r\n<th style=\"background:#f0f0f0;\" align=\"center\">Electronic-<br>\r\nCommutator (EC)<br>\r\nMotors<sup id=\"cite_ref-Ionel_.282010.29_62-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Ionel_.282010.29-62\">[61]</a></sup><sup id=\"cite_ref-63\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-63\">[b]</a></sup></th>\r\n<th style=\"background:#f0f0f0;\" align=\"center\"><br>\r\nAsynchronous<br>\r\nMachines</th>\r\n<th style=\"background:#f0f0f0;\" align=\"center\"><br>\r\nSynchronous<br>\r\nMachines<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote2\"><sup>2</sup></a></th>\r\n</tr>\r\n<tr>\r\n<th style=\"background:#f0f0f0;\" align=\"center\">AC<sup id=\"cite_ref-Alger_.281949b.29_64-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Alger_.281949b.29-64\">[62]</a></sup><sup id=\"cite_ref-65\" class=\"reference\"><a title=\"Link: https://en.wikipedia.org/wiki/Electric_motor#cite_note-65\" href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-65\">[c]</a></sup></th>\r\n<th style=\"background:#f0f0f0;\"><a href=\"https://en.wikipedia.org/wiki/Brushed_DC_electric_motor\" title=\"Brushed DC electric motor\">DC</a></th>\r\n<th style=\"background:#f0f0f0;\">AC<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote5\"><sup>5</sup></a><sup>,</sup> <a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote6\"><sup>6</sup></a></th>\r\n<th colspan=\"2\" style=\"background:#f0f0f0;\">AC<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote6\"><sup>6</sup></a></th>\r\n</tr>\r\n<tr>\r\n<th style=\"