r\">WRIM</a><a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote4\"><sup>4</sup></a><sup>,</sup> <a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote7\"><sup>7</sup></a><sup>,</sup> <a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote8\"><sup>8</sup></a><br>\r\n<br>\r\nAC motors:<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote10\"><sup>10</sup></a><br>\r\n* Capacitor<br>\r\n* Resistance<br>\r\n* Split<br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Shaded-pole_motor\" title=\"Shaded-pole motor\">Shaded-pole</a></th>\r\n<th style=\"background: #ffdead;\" align=\"left\">Three-phase motors:<br>\r\n<a href=\"https://en.wikipedia.org/wiki/Synchronous_motor\" title=\"Synchronous motor\">* WRSM</a><br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Permanent_magnet_synchronous_motor\" class=\"mw-redirect\" title=\"Permanent magnet synchronous motor\">PMSM</a> or<br>\r\n<a href=\"https://en.wikipedia.org/wiki/Brushless_AC_electric_motor\" class=\"mw-redirect\" title=\"Brushless AC electric motor\">BLAC motor</a><sup id=\"cite_ref-Ionel_.282010.29_62-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Ionel_.282010.29-62\">[61]</a></sup><br>\r\n- IPMSM<br>\r\n- SPMSM<br>\r\n* Hybrid<br>\r\n<br>\r\nAC motors:<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote10\"><sup>10</sup></a><br>\r\n* Permanent-split<br>\r\ncapacitor<br>\r\n* Hysteresis<br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Stepper_motor\" title=\"Stepper motor\">Stepper</a><br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Reluctance_motor\" title=\"Reluctance motor\">SyRM</a><br>\r\n* SyRM-PM hybrid</th>\r\n</tr>\r\n<tr>\r\n<th style=\"background:#f0f0f0;\" align=\"center\">Simple electronics</th>\r\n<th style=\"background:#f0f0f0;\" align=\"center\">Rectifier,<br>\r\nlinear transistor(s)<br>\r\nor DC chopper</th>\r\n<th style=\"background:#f0f0f0;\" align=\"ce