" align=\"center\"><br>\r\nSynchronous<br>\r\nMachines<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote2\"><sup>2</sup></a></th>\r\n</tr>\r\n<tr>\r\n<th style=\"background:#f0f0f0;\" align=\"center\">AC<sup id=\"cite_ref-Alger_.281949b.29_64-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Alger_.281949b.29-64\">[62]</a></sup><sup id=\"cite_ref-65\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-65\">[c]</a></sup></th>\r\n<th style=\"background:#f0f0f0;\"><a href=\"https://en.wikipedia.org/wiki/Brushed_DC_electric_motor\" title=\"Brushed DC electric motor\">DC</a></th>\r\n<th style=\"background:#f0f0f0;\">AC<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote5\"><sup>5</sup></a><sup>,</sup> <a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote6\"><sup>6</sup></a></th>\r\n<th colspan=\"2\" style=\"background:#f0f0f0;\">AC<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote6\"><sup>6</sup></a></th>\r\n</tr>\r\n<tr>\r\n<th style=\"background: #ffdead;\" align=\"left\">* <a href=\"https://en.wikipedia.org/wiki/Universal_motor\" title=\"Universal motor\">Universal motor</a><br>\r\n(AC commutator<br>\r\nseries motor<sup id=\"cite_ref-Stolting_.282008.29_61-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Stolting_.282008.29-61\">[60]</a></sup> or<br>\r\nAC/DC motor<sup id=\"cite_ref-Hameyer_.2A2001.29_60-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Hameyer_.2A2001.29-60\">[59]</a></sup>)<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote1\"><sup>1</sup></a><br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Repulsion_motor\" title=\"Repulsion motor\">Repulsion motor</a></th>\r\n<th style=\"background: #ffdead;\" align=\"left\">Electrically<br>\r\nexcited DC motor:<br>\r\n* Separately<br>\r\nexcited<br>\r\n* Series<br>\r\n* Shunt<br>\r\n* Compound<br>\r\n<br>\r\nPM DC motor</th>\r\n<th style=\"background: #ffdead;\" align=\"left\">With PM rotor:<br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Brushless_DC_motor\" class=\"mw-redirect\" title=\"Brushless DC motor\">BLDC motor</a><br>\r\n<br>\r\nWith<br>\r\nferromagnetic<br>\r\nrotor:<br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Switched_reluctance_motor\" title=\"Switched reluctance motor\">SRM</a><br></th>\r\n<th style=\"background: #ffdead;\" align=\"left\">Three-phase motors:<br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Induction_motor\" title=\"Induction motor\">SCIM</a><a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote3\"><sup>3</sup></a><sup>,</sup> <a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote8\"><sup>8</sup></a><br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Wound_rotor_motor\" title=\"Wound rotor motor\">WRIM</a><a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote4\"><sup>4</sup></a><sup>,</sup> <a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote7\"><sup>7</sup></a><sup>,</sup> <a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote8\"><sup>8</sup></a><br>\r\n<br>\r\nAC motors:<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote10\"><sup>10</sup></a><br>\r\n* Capacitor<br>\r\n* Resistance<br>\r\n* Split<br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Shaded-pole_motor\" title=\"Shaded-pole motor\">Shaded-pole</a></th>\r\n<th style=\"background: #ffdead;\" align=\"left\">Three-phase motors:<br>\r\n<a href=\"https://en.wikipedia.org/wiki/Synchronous_motor\" title=\"Synchronous motor\">* WRSM</a><br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Permanent_magnet_synchronous_motor\" class=\"mw-redirect\" title=\"Permanent magnet synchronous motor\">PMSM</a> or<br>\r\n<a href=\"https://en.wikipedia.org/wiki/Brushless_AC_electric_motor\" class=\"mw-redirect\" title=\"Brushless AC electric motor\">BLAC motor</a><sup id=\"cite_ref-Ionel_.282010.29_62-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electric_motor#cite_note-Ionel_.282010.29-62\">[61]</a></sup><br>\r\n- IPMSM<br>\r\n- SPMSM<br>\r\n* Hybrid<br>\r\n<br>\r\nAC motors:<a href=\"https://en.wikipedia.org/wiki/Electric_motor#CharacterizatioNote10\"><sup>10</sup></a><br>\r\n* Permanent-split<br>\r\ncapacitor<br>\r\n* Hysteresis<br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Stepper_motor\" title=\"Stepper motor\">Stepper</a><br>\r\n* <a href=\"https://en.wikipedia.org/wiki/Reluctance_motor\" title=\"Reluctance motor\">SyRM</a><br>\r\n* SyRM-PM hybrid</th>\r\n</tr>\r\n<tr>\r\n<th style=\"background:#f0f0f0;\" align=\"center\">Simple electronics</th>\r\n<th style=\"background:#f0f0f0;\" align=\"center\">Rectifier,<br>\r\nlinear transistor(s)<br>\r\nor DC chopper</th>\r\n<th style=\"background:#f0f0f0;\" align=\"center\">More elaborate<br>\r\nelectronics</th>\r\n<th colspan=\"2\" style=\"background:#f0f0f0;\" align=\"center\">Most elaborate</th></tr></tbody></table>',1,1,32,NULL,'2016-06-15 13:18:57','2016-06-15 13:18:57'),(56,95,'<h1 id=\"firstHeading\" class=\"firstHeading\" lang=\"en\">Two-phase electric power</h1>\r\n									<div id=\"bodyContent\" class=\"mw-body-content\">\r\n									<div id=\"siteSub\">From Wikipedia, the free encyclopedia</div>\r\n								\r\n												</div><div role=\"note\" class=\"hatnote\">This article is about electric systems with 90 phase difference. For systems with two opposite (180) live wires, see <a href=\"https://en.wikipedia.org/wiki/Split-phase_electric_power\" title=\"Split-phase electric power\">split-phase electric power</a>.</div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width:402px;\"><a href=\"https://en.wikipedia.org/wiki/File:Elementary_Two_Phase_Alternator.jpg\" class=\"image\"><img title=\"Image: https://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Elementary_Two_Phase_Alternator.jpg/400px-Elementary_Two_Phase_Alternator.jpg\" alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Elementary_Two_Phase_Alternator.jpg/400px-Elementary_Two_Phase_Alternator.jpg\" class=\"thumbimage\" data-file-width=\"3405\" data-file-height=\"1633\" height=\"192\" width=\"400\"></a>\r\n<div class=\"thumbcaption\">\r\n</div></div></div><div class=\"thumb tright\"><div class=\"thumbinner\" style=\"width:402px;\"><div class=\"thumbcaption\">\r\nA simplified diagram of a two-phase alternator<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Two-phase_electric_power#cite_note-1\">[1]</a></sup></div>\r\n</div>\r\n</div>\r\n<b>Two-phase electrical power</b> was an early 20th-century <a href=\"https://en.wikipedia.org/wiki/Polyphase_system\" title=\"Polyphase system\">polyphase</a> <a href=\"https://en.wikipedia.org/wiki/Alternating_current\" title=\"Alternating current\">alternating current</a> electric power distribution system. Two circuits were used, with voltage <a href=\"https://en.wikipedia.org/wiki/Phase_%28waves%29\" title=\"Phase (waves)\">phases</a>\r\n differing by one-quarter of a cycle, 90. Usually circuits used four \r\nwires, two for each phase. Less frequently, three wires were used, with a\r\n common wire with a larger-diameter conductor. Some early two-phase <a href=\"https://en.wikipedia.org/wiki/Electric_generator\" title=\"Electric generator\">generators</a> had two complete rotor and field assemblies, with windings physically offset to provide two-phase power. The generators at <a href=\"https://en.wikipedia.org/wiki/Niagara_Falls\" title=\"Niagara Falls\">Niagara Falls</a>\r\n installed in 1895 were the largest generators in the world at that time\r\n and were two-phase machines. As of 21st century, two-phase power was \r\nsuperseded with <a href=\"https://en.wikipedia.org/wiki/Three-phase_electrical_power\" class=\"mw-redirect\" title=\"Three-phase electrical power\">three phases</a> and is not used in the industry. There remains, however, a two-phase commercial distribution system in <a href=\"https://en.wikipedia.org/wiki/Philadelphia\" title=\"Philadelphia\">Philadelphia</a>, <a href=\"https://en.wikipedia.org/wiki/Pennsylvania\" title=\"Pennsylvania\">Pennsylvania</a>; many buildings',1,1,32,NULL,'2016-06-16 10:09:26','2016-06-16 10:09:26'),(59,113,'hi<br>',1,1,32,NULL,'2016-06-16 12:52:12','2016-06-16 12:52:12'),(60,113,'Hii',1,1,32,NULL,'2016-06-17 14:09:44','2016-06-17 14:09:44'),(61,183,'Hi&nbsp;',2,1,65,1,'2016-06-25 19:17:51','2016-06-25 19:19:21'),(62,183,'hi',2,1,65,1,'2016-06-25 19:21:46','2016-06-25 19:22:05'),(63,184,'HIIIIIIIIIIIIIIII',2,1,65,1,'2016-06-25 19:31:03','2016-06-25 19:31:20'),(67,188,'Hello,<br>We are glad to hear that.',1,1,32,NULL,'2016-06-27 09:55:14','2016-06-27 09:55:14'),(68,190,'ok',1,1,32,NULL,'2016-06-27 10:16:44','2016-06-27 10:16:44'),(70,192,'This is test accept message',2,1,32,1,'2016-06-30 09:30:52','2016-06-30 09:31:30'),(71,193,'Test acceptance',2,1,32,1,'2016-06-30 12:34:07','2016-06-30 12:37:29'),(72,194,'ok',1,1,32,NULL,'2016-06-30 12:57:29','2016-06-30 12:57:29'),(73,195,'Answer for this question.',2,1,69,1,'2016-07-04 11:20:02','2016-07-04 11:31:41'),(74,197,'i accept this.',2,1,69,1,'2016-07-04 11:21:30','2016-07-04 11:32:45'),(75,196,'Sorry...i can\'t accept this..',2,1,69,1,'2016-07-04 11:22:39','2016-07-04 11:32:16'),(76,198,'hi',2,1,70,1,'2016-07-04 20:23:46','2016-07-04 20:24:18'),(77,201,'request accepted.',2,1,69,1,'2016-07-05 05:54:54','2016-07-05 06:02:06'),(78,199,'hello.. test answer',2,1,69,1,'2016-07-05 05:57:02','2016-07-05 06:01:48'),(79,200,'rejected offer.',2,1,69,1,'2016-07-05 06:00:00','2016-07-05 06:02:19'),(80,203,'its rejected.........',2,1,69,1,'2016-07-05 06:56:00','2016-07-05 06:59:51'),(81,202,'accepted',2,1,69,1,'2016-07-05 06:56:29','2016-07-05 07:00:09'),(82,204,'hi',2,1,70,1,'2016-07-05 13:12:38','2016-07-05 13:13:05'),(83,205,'ok sure, please do purchase it.',2,1,70,1,