o.com','Hi\r\nxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx',5250000.00,3,22,2,2,'2016-06-03 12:34:20','2016-06-03 16:29:44','Accepted',2,1,1,1),(95,'abc','abc@gmail.com','123456789632211112',103,'gfghf','jhgj','kjhkjhkjh',768.00,1,24,2,2,'2016-06-04 12:06:49','2016-06-16 12:02:36','<h1 id=\"firstHeading\" class=\"firstHeading\" lang=\"en\">Two-phase electric power</h1>\r\n									<div id=\"bodyContent\" class=\"mw-body-content\">\r\n									<div id=\"siteSub\">From Wikipedia, the free encyclopedia</div>\r\n								\r\n												</div><div role=\"note\" class=\"hatnote\">This article is about electric systems with 90 phase difference. For systems with two opposite (180) live wires, see <a href=\"https://en.wikipedia.org/wiki/Split-phase_electric_power\" title=\"Split-phase electric power\">split-phase electric power</a>.</div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width:402px;\"><a href=\"https://en.wikipedia.org/wiki/File:Elementary_Two_Phase_Alternator.jpg\" class=\"image\"><img title=\"Image: https://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Elementary_Two_Phase_Alternator.jpg/400px-Elementary_Two_Phase_Alternator.jpg\" alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Elementary_Two_Phase_Alternator.jpg/400px-Elementary_Two_Phase_Alternator.jpg\" class=\"thumbimage\" data-file-width=\"3405\" data-file-height=\"1633\" height=\"192\" width=\"400\"></a>\r\n<div class=\"thumbcaption\">\r\n</div></div></div><div class=\"thumb tright\"><div class=\"thumbinner\" style=\"width:402px;\"><div class=\"thumbcaption\">\r\nA simplified diagram of a two-phase alternator<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Two-phase_electric_power#cite_note-1\">[1]</a></sup></div>\r\n</div>\r\n</div>\r\n<b>Two-phase electrical power</b> was an early 20th-century <a href=\"https://en.wikipedia.org/wiki/Polyphase_system\" title=\"Polyphase system\">polyphase</a> <a href=\"https://en.wikipedia.org/wiki/Alternating_current\" title=\"Alternating current\">alternating current</a> electric power distribution system. Two circuits were used, with voltage <a href=\"https://en.wikipedia.org/wiki/Phase_%28waves%29\" title=\"Phase (waves)\">phases</a>\r\n differing by one-quarter of a cycle, 90. Usually circuits used four \r\nwires, two for each phase. Less frequently, three wires were used, with a\r\n common wire with a larger-diameter conductor. Some early two-phase <a href=\"https://en.wikipedia.org/wiki/Electric_generator\" title=\"Electric generator\">generators</a> had two complete rotor and field assemblies, with windings physically offset to provide two-phase power. The generators at <a href=\"https://en.wikipedia.org/wiki/Niagara_Falls\" title=\"Niagara Falls\">Niagara Falls</a>\r\n installed in 1895 were the largest generators in the world at that time\r\n and were two-phase machines. As of 21st century, two-phase power was \r\nsuperseded with <a href=\"https://en.wikipedia.org/wiki/Three-phase_electrical_power\" class=\"mw-redirect\" title=\"Three-phase electrical power\">three phases</a> and is not used in the industry. There remains, however, a two-phase commercial distribution system in <a href=\"https://en.wikipedia.org/wiki/Philadelphia\" title=\"Philadelphia\">Philadelphia</a>, <a href=\"https://en.wikipedia.org/wiki/Pennsylvania\" title=\"Pennsylvania\">Pennsylvania</a>; many buildings',1,1,1,1),(104,'ibrahim','ibrahim_sameeh@yahoo.com','0788574890',6,'Power cozmo ','www.leadingco.com','your price was very high',2000.00,2,29,2,2,'2016-06-04 15:13:58','2016-06-28 19:15:11','',NULL,0,1,0),(105,'ibrahim','ibrahim_sameeh@yahoo.com','0788574890',6,'Power cozmo ','www.leadingco.com','your price was very high',2000.00,2,29,3,2,'2016-06-04 15:14:17','2016-06-04 15:16:00','Rejected',2,1,1,1),(106,'ghj','hgj@df.ijn','453454353453454353',6,'45345345','www.ghgh.bim','45345345',NULL,1,29,1,2,'2016-06-06 04:34: