INSERT INTO `faqs` VALUES (1,'Why do I go for&nbsp;power Cozmo?','Power Cozmo has a highly skilled staff ready to serve you. To learn more about power Cozmo visit our<a href=\"/#why-one\"> Why us? </a>page and Welcome to power Cozmo page.',1,1,'2016-05-24 13:44:27','2016-06-09 12:38:07'),(2,'What services does Power Cozmo provide?','<ul><li> Sell & Buy Used and surplus power equipment</li><li> Overhaul & rehabilitation.</li><li> Reallocation and setup, For more information visit Our services pages.</li></ul>',1,2,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(3,'How do I list an item I want to sell?','To list an item through Power Cozmo you must first to register in site by clicking on register button in the top of page . Then you can list your equipment from your own dashboard , Equipment should be honestly described and pictures attached. The selling price should be in US dollars or Euro . A qualified staff person will contact you to go over the details, answer any questions and finalize the commission structure. When the agreement is signed your item is posted to the web site.',1,3,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(4,'How do I buy a listed item?','You can click on buying now button and fill out the form and we contact you shortly , also if you have any raised question or need price negotiation with seller you can do that through our automated platform',1,4,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(5,'Im looking for an item that is not on your equipment for sale list.:','If you are looking for an item we do not currently have on our inventory list simply You can fill out the Buying request formEby clicking on buying request button found in the top of the page.. We will notify you as soon as it becomes available.',1,5,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(6,'How do I pay for an item?','Payment can be made by Wire transfer , or by Letter of credit (L\\C).',1,6,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(7,'As a buyer, what other costs might I have to pay over and above the listed or negotiated price?','The cost for shipping, insurance and applicable sales tax, unless agreed otherwise, will be at your expense and will be included with your item payment. If there are any other costs they will be negotiated and documented in your seller/buyer agreement.',1,7,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(8,'How do I figure out shipping?','We are provided the weight and physical dimensions of the item to be shipped so that shipping costs can be calculated and quoted. If the item being shipped is in more than one package the number of packages with their individual weights and dimensions will be made known.',1,8,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(9,'Does Power Cozmo ship internationally?','Yes. Power Cozmo services all markets both domestic and international and can containerize and crate all machinery for export.',1,9,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(10,'Should I be concerned about purchasing used equipment?','No. Remember, every piece of equipment in your plant is a piece of used equipment. You should not hesitate to buy used equipment from a reliable source.',1,10,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(11,'Do I have the right to return an equipment?','Yes. Most machines come with our \"right to return policyE visit our<a href=\"/our-policy\"> Warranty and Returns Policy</a> page for more information.',1,11,'2016-05-24 13:44:27','2016-06-09 12:52:14'),(12,'Can I trade in a machine?','Yes. If the machine is of good quality, there is nothing wrong with \"horse trading.\"',1,12,'2016-05-24 13:44:27','2016-05-24 13:44:27'),(14,'<div>&nbsp;&nbsp;&nbsp; How do I buy a listed item?</div>','',1,NULL,'2016-06-17 06:29:16','2016-06-17 06:41:06');
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
