16-06-11 08:40:07','2016-06-11 08:40:07',0,NULL),(34,'Mailboxer::Message','Dear Sir<br>Greetings ! Hope all is going well with you .<br>I have many items to list please contact me to list them .<br>Thank you<br><br><br><br>','Item to list ',48,'User',19,0,NULL,NULL,NULL,NULL,'2016-06-11 17:26:17','2016-06-11 17:26:17',0,NULL),(35,'Mailboxer::Message','Dear Sir<br>Greetings ! Hope all is going well with you .<br>I have many items to list please contact me to list them .<br>Thank you<br><br><br><br>','Item to list ',48,'User',20,0,NULL,NULL,NULL,NULL,'2016-06-11 17:26:27','2016-06-11 17:26:27',0,NULL),(36,'Mailboxer::Message','ok<br>Please send them to me<br><br>','Item to list ',4,'AdminUser',20,0,NULL,NULL,NULL,NULL,'2016-06-11 17:27:10','2016-06-11 17:27:10',0,NULL),(37,'Mailboxer::Message','Hello please send me details<br>','uytutyuy',32,'User',21,0,NULL,NULL,NULL,'Wildlife.wmv','2016-06-13 05:49:29','2016-06-13 05:49:29',0,NULL),(38,'Mailboxer::Message','Hello please send me details 12345678897897897897979789<br>','uytutyuy',32,'User',22,0,NULL,NULL,NULL,'Wildlife.wmv','2016-06-13 05:50:33','2016-06-13 05:50:33',0,NULL),(39,'Mailboxer::Message','hello testing 1234343Winding\" redirects here. For other uses, see <a href=\"https://en.wikipedia.org/wiki/Winding_%28disambiguation%29\" class=\"mw-disambig\" title=\"Winding (disambiguation)\">Winding (disambiguation)</a>.\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\">\n<a href=\"https://en.wikipedia.org/wiki/File:Magnetic_field_of_loop_3.svg\" class=\"image\"><img title=\"Image: https://upload.wikimedia.org/wikipedia/commons/thumb/b/b7/Magnetic_field_of_loop_3.svg/220px-Magnetic_field_of_loop_3.svg.png\" alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b7/Magnetic_field_of_loop_3.svg/220px-Magnetic_field_of_loop_3.svg.png\" class=\"thumbimage\" height=\"219\" width=\"220\"></a>\r\n<div class=\"thumbcaption\">\r\n</div>\n</div>\n</div><div class=\"thumb tright\">\n<div class=\"thumbinner\">\n<div class=\"thumbcaption\">\r\nThe magnetic field lines <i>(<span>green</span>)</i> of a current-carrying loop of wire pass through the center of the loop, concentrating the field there</div>\r\n</div>\r\n</div>\r\n<p>An <b>electromagnetic coil</b> is an electrical <a href=\"https://en.wikipedia.org/wiki/Electrical_conductivity\" class=\"mw-redirect\" title=\"Electrical conductivity\">conductor</a> such as a <a href=\"https://en.wikipedia.org/wiki/Wire\" title=\"Wire\">wire</a> in the shape of a <a href=\"https://en.wiktionary.org/wiki/coil\" class=\"extiw\" title=\"wiktionary:coil\">coil</a>, <a href=\"https://en.wikipedia.org/wiki/Spiral\" title=\"Spiral\">spiral</a> or <a href=\"https://en.wikipedia.org/wiki/Helix\" title=\"Helix\">helix</a>.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Stauffer-1\">[1]</a></sup><sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Laplante-2\">[2]</a></sup> Electromagnetic coils are used in <a href=\"https://en.wikipedia.org/wiki/Electrical_engineering\" title=\"Electrical engineering\">electrical engineering</a>, in applications where <a href=\"https://en.wikipedia.org/wiki/Electric_current\" title=\"Electric current\">electric currents</a> interact with <a href=\"https://en.wikipedia.org/wiki/Magnetic_field\" title=\"Magnetic field\">magnetic fields</a>, in devices such as <a href=\"https://en.wikipedia.org/wiki/Inductor\" title=\"Inductor\">inductors</a>, <a href=\"https://en.wikipedia.org/wiki/Electromagnet\" title=\"Electromagnet\">electromagnets</a>, <a href=\"https://en.wikipedia.org/wiki/Transformer\" title=\"Transformer\">transformers</a>,\r\n and sensor coils. Either an electric current is passed through the wire\r\n of the coil to generate a magnetic field, or conversely an external <i>time-varying</i> magnetic field through the interior of the coil generates an <a href=\"https://en.wikipedia.org/wiki/Electromotive_force\" title=\"Electromotive force\">EMF</a> (<a href=\"https://en.wikipedia.org/wiki/Voltage\" title=\"Voltage\">voltage</a>) in the conductor.</p>\r\n<p>A current through any conductor creates a circular magnetic field around the conductor due to <a href=\"https://en.wikipedia.org/wiki/Ampere%27s_circuital_law\" class=\"mw-redirect\" title=\"Ampere\'s circuital law\">Ampere\'s law</a>.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Arun-3\">[3]</a></sup>\r\n The advantage of using the coil shape is that it increases the strength\r\n of magnetic field produced by a given current. The magnetic fields \r\ngenerated by the separate turns of wire all pass through the center of \r\nthe coil and add (<a href=\"https://en.wikipedia.org/wiki/Superposition_principle\" title=\"Superposition principle\">superpose</a>) to produce a strong field there.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Arun-3\">[3]</a></sup> The more turns of wire, the stronger the field produced. Conversely, a <i>changing</i> external magnetic flux induces a voltage in a conductor such as a wire, due to <a href=\"https://en.wikipedia.org/wiki/Faraday%27s_law_of_induction\" title=\"Faraday\'s law of induction\">Faraday\'s law of induction</a>.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Arun-3\">[3]</a></sup><sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-4\">[4]</a></sup>\r\n The induced voltage can be increased by winding the wire into a coil, \r\nbecause the field lines intersect the circuit multiple times.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Arun-3\">[3]</a></sup></p>\r\nThe direction of the magnetic field produced by a coil can be determined by the <a href=\"https://en.wikipedia.org/wiki/Right_hand_grip_rule\" class=\"mw-redirect\" title=\"Right hand grip rule\">right hand grip rule</a>. If the fingers of the right hand are','uytutyuy',4,'AdminUser',22,0,NULL,NULL,NULL,'Desert.jpg','2016-06-13 05:51:52','2016-06-13 05:51:52',0,NULL),(40,'Mailboxer::Message','<h2><span class=\"mw-headline\">Magnetic core</span></h2><p>Many electromagnetic coils have a <a href=\"https://en.wikipedia.org/wiki/Magnetic_core\" title=\"Magnetic core\">magnetic core</a>, a piece of <a href=\"https://en.wikipedia.org/wiki/Ferromagnetic\" class=\"mw-redirect\" title=\"Ferromagnetic\">ferromagnetic</a> material like <a href=\"https://en.wikipedia.org/wiki/Iron\" title=\"Iron\">iron</a> in the center to increase the magnetic field.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-Laplante1-11\">[11]</a></sup>\r\n The current through the coil magnetizes the iron, and the field of the \r\nmagnetized material adds to the field produced by the wire. This is \r\ncalled a <b>ferromagnetic-core</b> or <b>iron-core coil</b>.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-12\">[12]</a></sup>\r\n A ferromagnetic core can increase the magnetic field of a coil by \r\nhundreds or thousands of times over what it would be without the core. A\r\n <b>ferrite core coil</b> is a variety of coil with a core made of <a href=\"https://en.wikipedia.org/wiki/Ferrite_core\" title=\"Ferrite core\">ferrite</a>, a <a href=\"https://en.wikipedia.org/wiki/Ferrimagnetic\" class=\"mw-redirect\" title=\"Ferrimagnetic\">ferrimagnetic</a> ceramic compound.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-13\">[13]</a></sup> Ferrite coils have lower losses at high frequencies.</p>\r\n<p>A coil without a ferromagnetic core is called an <b>air-core coil</b>.<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Electromagnetic_coil#cite_note-14\">[14]</a></sup>\r\n This includes coils wound on plastic or other nonmagnetic forms, as \r\nwell as coils which actually have empty air space inside their windings.</p>','uytutyuy',32,'User',22,0,NULL,NULL,NULL,NULL,'2016-06-13 05:54:20','2016-06-13 05:54:20',0,NULL),(41,'Mailboxer::Message','<h3><span class=\"mw-headline\">Inductors</span></h3>\r\n<div class=\"thumbinner\">\n<a href=\"https://en.wikipedia.org/wiki/File:Transmitter_tank_inductor.jpg\" class=\"image\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/ac/Transmitter_tank_inductor.jpg/220px-Transmitter_tank_inductor.jpg\" class=\"thumbimage\" height=\"188\" width=\"220\"></a>\r\n<div class=\"thumbcaption\">\r\n</div>\n</div><div class=\"thumb tright\">\n<div class=\"thumbinner\">\n<div class=\"thumbcaption\">\r\nTank inductor in a <a href=\"https://en.wikipedia.org/wiki/Tuned_circuit\" class=\"mw-redirect\" title=\"Tuned circuit\">tuned circuit</a> in a shortwave <a href=\"https://en.wikipedia.org/wiki/Transmitter\" title=\"Transmitter\">radio transmitter</a>\n</div>\r\n</div>\r\n</div>\r\n<div class=\"hatnote relarticle mainarticle\">Main article: <a href=\"https://en.wikipedia.org/wiki/Inductor\" title=\"Inductor\">Inductor</a>\n</div>\r\n<p><a href=\"https://en.wikipedia.org/wiki/Inductor\" title=\"Inductor\">Inductors</a>\r\n or reactors are coils which generate a magnetic field which interacts \r\nwith the coil itself, to induce a back EMF which opposes changes in \r\ncurrent through the coil. Inductors are used as <a href=\"https://en.wikipedia.org/wiki/Circuit_element\" class=\"mw-redirect\" title=\"Circuit element\">circuit elements</a> in electrical circuits, to temporarily store energy or resist changes in current. A few types:</p>\r\n<dl><dd>\r\n<ul>\n<li>Tank coil - an inductor used in a <a href=\"https://en.wikipedia.org/wiki/Tuned_circuit\" class=\"mw-redirect\" title=\"Tuned circuit\">tuned circuit</a>\n</li>\n<li>\n<a href=\"https://en.wikipedia.org/wiki/Choke_%28electronics%29\" title=\"Choke (electronics)\">Choke</a> - an inductor used to block high frequency AC while allowing through low frequency AC.</li>\n<li>\n<a href=\"https://en.wikipedia.org/wiki/Loading_coil\" title=\"Loading coil\">Loading coil</a> - an inductor used to add inductance to an antenna, to make it resonant, or to a cable to prevent distortion of signals.</li>\n<li>\n<a href=\"https://en.wikipedia.org/wiki/Variometer\" title=\"Variometer\">Variometer</a>\r\n - an adjustable inductor consisting of two coils in series, an outer \r\nstationary coil and a second one inside it which can be rotated so their\r\n magnetic axes are in the same direction or opposed.</li>\n<li>\n<a href=\"https://en.wikipedia.org/wiki/Flyback_transformer\" title=\"Flyback transformer\">Flyback transformer</a> - Although called a transformer, this is actually an inductor which serves to store energy in <a href=\"https://en.wikipedia.org/wiki/Switching_power_supply\" class=\"mw-redirect\" title=\"Switching power supply\">switching power supplies</a> and horizontal deflection circuits for <a href=\"https://en.wikipedia.org/wiki/Cathode_ray_tube\" title=\"Cathode ray tube\">CRT</a> televisions and monitors</li>\n<li>\n<a href=\"https://en.wikipedia.org/wiki/Saturable_reactor\" title=\"Saturable reactor\">Saturable reactor</a>\r\n - an iron-core inductor used to control AC power by varying the \r\nsaturation of the core using a DC control voltage in an auxiliary \r\nwinding.</li>\n<li>\n<a href=\"https://en.wikipedia.org/wiki/Electrical_ballast\" title=\"Electrical ballast\">Inductive ballast</a> - an inductor used in <a href=\"https://en.wikipedia.org/wiki/Gas-discharge_lamp\" title=\"Gas-discharge lamp\">gas-discharge lamp</a> circuits, such as <a href=\"https://en.wikipedia.org/wiki/Fluorescent_lamp\" title=\"Fluorescent lamp\">fluorescent lamps</a>, to limit the current through the lamp.</li>\n</ul>\r\n</dd></dl>','uytutyuy',32,'User',22,0,NULL,NULL,NULL,'Chrysanthemum.jpg','2016-06-13 05:55:26','2016-06-13 05:55:26',0,NULL),(42,'Mailboxer::Message','<h3><span class=\"mw-headline\">Transformers</span></h3>\r\n<div class=\"thumbinner\">\n<a href=\"https://en.wikipedia.org/wiki/File:Trafo-innenleben.jpg\" class=\"image\"><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/7/76/Trafo-innenleben.jpg/220px-Trafo-innenleben.jpg\" class=\"thumbimage\" height=\"191\" width=\"220\"></a>\r\n<div class=\"thumbcaption\">\r\n</div>\n</div><div class=\"thumb tright\">\n<div class=\"thumbinner\">\n<div class=\"thumbcaption\">\r\nTransformer</div>\r\n</div>\r\n</div>\r\n<div class=\"hatnote relarticle mainarticle\">Main article: <a href=\"https://en.wikipedia.org/wiki/Transformer\" title=\"Transformer\">Transformer</a>\n</div>\r\nA transformer is a device with two or more magnetically coupled \r\nwindings (or sections of a single winding). A time varying current in \r\none coil (called the <a href=\"https://en.wikipedia.org/wiki/Primary_winding\" class=\"mw-redirect\" title=\"Primary winding\">primary winding</a>) generates a','Transformers',32,'User',23,0,NULL,NULL,NULL,'6.jpg','2016-06-13 06:00:51','2016-06-13 06:00:51',0,NULL),(43,'Mailboxer::Message','<p>These are coils used to translate time-varying magnetic fields to electric signals, and vice versa. A few types:</p>\r\n\r\n<ul>\n<li>Sensor or pickup coils - these are used to detect external time-varying magnetic fields</li>\n<li>\n<a href=\"https://en.wikipedia.org/wiki/Inductive_sensor\" title=\"Inductive sensor\">Inductive sensor</a> - a coil which senses when a magnet or iron object passes near it</li>\n<li>\n<a href=\"https://en.wikipedia.org/wiki/Recording_head\" title=\"Recording head\">Recording head</a> - a coil which is used to create a magnetic field to write data to a <a href=\"https://en.wikipedia.org/wiki/Magnetic_storage\" title=\"Magnetic storage\">magnetic storage</a> medium, such as <a href=\"https://en.wikipedia.org/wiki/Magnetic_tape\" title=\"Magnetic tape\">magnetic tape</a>, or a <a href=\"https://en.wikipedia.org/wiki/Hard_disk\" class=\"mw-redirect\" title=\"Hard disk\">hard disk</a>. Conversely it is also used to read the data in the form of changing magnetic fields in the medium.</li>\n<li><a href=\"https://en.wikipedia.org/wiki/Induction_heating\" title=\"Induction heating\">Induction he</a></li>\n</ul>','Transducer coils',1,'User',24,0,NULL,NULL,NULL,'BFA0018-1_635927067099371172.jpg','2016-06-13 06:05:05','2016-06-13 06:05:05',0,NULL),(44,'Mailboxer::Message','<a href=\"https://en.wikipedia.org/wiki/Rogowski_coil\" title=\"Rogowski coil\">Rogowski coil</a> - a toroidal coil used as an AC measuring device','Transformers',4,'AdminUser',23,0,NULL,NULL,NULL,'HJ15_photo2-130571792664073437.jpg','2016-06-13 06:06:34','2016-06-13 06:06:34',0,NULL),(45,'Mailboxer::Message','What is the price.<br>','Transformers',32,'User',23,0,NULL,NULL,NULL,'1.jpg','2016-06-13 06:15:05','2016-06-13 06:15:05',0,NULL),(46,'Mailboxer::Message','Hello','Transformers',4,'AdminUser',23,0,NULL,NULL,NULL,NULL,'2016-06-13 06:16:11','2016-06-13 06:16:11',0,NULL),(47,'Mailboxer::Message','hello<br>','dffghfgh',32,'User',25,0,NULL,NULL,NULL,NULL,'2016-06-13 06:17:11','2016-06-13 06:17:11',0,NULL),(48,'Mailboxer::Message','sfgdfgd','Transformers',4,'AdminUser',23,0,NULL,NULL,NULL,NULL,'2016-06-13 06:17:52','2016-06-13 06:17:52',0,NULL),(49,'Mailboxer::Message','what i<br>','Transformers',32,'User',23,0,NULL,NULL,NULL,NULL,'2016-06-13 06:20:34','2016-06-13 06:20:34',0,NULL),(50,'Mailboxer::Message','dfgdfgdg<br>','Transformers',32,'User',23,0,NULL,NULL,NULL,NULL,'2016-06-13 06:24:40','2016-06-13 06:24:40',0,NULL),(51,'Mailboxer::Message','ffhfghfghfhfh','Transformers',4,'AdminUser',23,0,NULL,NULL,NULL,NULL,'2016-06-13 06:25:37','2016-06-13 06:25:37',0,NULL),(52,'Mailboxer::Message','<a href=\"https://en.wikipedia.org/wiki/Pickup_%28music_technology%29\" title=\"Pickup (music technology)\">Musical instrument pickup</a> -','Transformers',32,'User',23,0,NULL,NULL,NULL,NULL,'2016-06-13 06:30:18','2016-06-13 06:30:18',0,NULL),(53,