iki/European_Union\" title=\"European Union\">European Union</a> and all countries who use European <a href=\"https://en.wikipedia.org/wiki/CENELEC\" class=\"mw-redirect\" title=\"CENELEC\">CENELEC</a> standards since April 2004 (<a href=\"https://en.wikipedia.org/wiki/IEC_60446\" title=\"IEC 60446\">IEC 60446</a>):\r\n United Kingdom since 31 March 2004, Hong Kong from July 2007, Singapore\r\n from March 2009, Russia since 2009 (GOST R 50462), Argentina, Ukraine, \r\nBelarus, Kazakhstan\r\nBrown\r\nBlack\r\nGrey\r\nBlue\r\nGreen/yellow striped<sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Three-phase_electric_power#cite_note-note2-25\">[note 2]</a></sup>\r\n\r\n\r\nOlder European (prior to <a href=\"https://en.wikipedia.org/wiki/IEC_60446\" title=\"IEC 60446\">IEC 60446</a>, varied by country <sup class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Three-phase_electric_power#cite_note-note3-26\">[note 3]</a></sup>\r\nRed\r\nYellow\r\nBlue\r\nBlack\r\nGreen/yellow striped (green on installations before c. 1970)\r\n\r\n\r\nUK before April 2006, Hong Kong before April 2009, South Africa, Malaysia, Singapore before February 2011\r\nRed\r\nYellow\r\nBlue\r\nBlack\r\nGreen/yellow striped (green on installations before c. 1970)\r\n\r\n\r\nIndia\r\nRed\r\nYellow\r\nBlue\r\nBlack\r\nGreen/yellow striped, or green\r\n\r\n\r\nFormer USSR (Russia, Ukraine, Kazakhstan) before 2009, People\'s Republic of China (per GB 50303-2002 Section 15.2.2)\r\nYellow\r\nGreen\r\nRed\r\nSky blue\r\nGreen/yellow striped\r\n\r\n\r\nNorway\r\nBlack\r\nWhite/Grey\r\nBrown\r\nBlue\r\nYellow/green striped, older may be only yellow or bare copper\r\n\r\n\r\nUnited States (common practice)<sup class=\"reference\"><a title=\"Link: https://en.wikipedia.org/wiki/Three-phase_electric_power#cite_note-note4-27\" href=\"https://en.wikipedia.org/wiki/Three-phase_electric_power#cite_note-note4-27\">[note 4]</a></sup>\r\nBlack\r\nRed\r\nBlue\r\nWhite, or grey\r\nGreen, green/yellow st