ge for your record.</p>\n\n<p>Name: <strong>::REQUESTER_NAME::</strong></p>\n\n<p>E-mail: <strong>::REQUESTER_EMAIL::</strong></p>\n\n<p>Country: <strong>::REQUESTER_COUNTRY::</strong></p>\n\n<p>Buying request name:&nbsp;<strong>::BUYING_REQUEST_NAME::</strong></p>\n\n<p>Expiration date: <strong>::DATE_OF_EXPIERY::</strong></p>\n\n<p>&nbsp;</p>\n\n<p>Best Regards</p>\n\n<p>Power Cozmo Team</p>',NULL,1,'2016-06-03 13:59:33','2016-06-17 07:26:17','MAIL-018'),(19,'Email to sellers about Buying request expiry renewed by requester.','extension of closed date for Buying request ::BUYING_REQUEST_NAME::','<p>HELLO!</p>\n\n<p>We want to draw your attention that buying request <strong>::BUYING_REQUEST_NAME::</strong> closing date extended now. So please submit your proposal before new expiry date.</p>\n\n<p>You can check the detail of this request from this link:</p>\n\n<p>LINK_TO_BUYING_REQUESTS_URL</p>\n\n<p>Or from your dashboard under buying request filed, you can request for more information or click on submit proposal To send buyer your proposal.</p>\n\n<p>LINK_TO_SELLER_BUYING_REQUESTS_URL</p>\n\n<p>&nbsp;</p>\n\n<p>Name: <strong>::REQUESTER_NAME::</strong></p>\n\n<p>E-mail: <strong>::REQUESTER_EMAIL::</strong></p>\n\n<p>Country: <strong>::REQUESTER_COUNTRY::</strong></p>\n\n<p>Buying request name:&nbsp;<strong>::BUYING_REQUEST_NAME::</strong></p>\n\n<p>Expiration date: <strong>::NEW</strong>_<strong>DATE_OF_EXPIERY::</strong>.</p>\n\n<p>&nbsp;</p>\n\n<p>Best Regards</p>\n\n<p>Power Cozmo Team</p>',NULL,1,'2016-06-03 13:59:33','2016-06-17 07:26:17','MAIL-019'),(20,'Email to seller after successful of Listing new equipment.','Congratulation! Your advertising is live now.','<p>Hello <strong>::SELLER_NAME::</strong></p>\n\n<p>Thank you for listing your <strong>::ITEM_NAME::</strong> with power Cozmo. Now your advertising is live for thousands of buyers worldwide. A Power Cozmo representative will contact you in case of any raised enquiry. Please print this page for your r